Find out what happens to Jay and Silent Bob as they head away from the Garden State and into the world of 'Dogma'. Yes folks, this comic is the only way to find out the events that transpire between their adventures in Chasing Amy and their hijinks in Dogma! Issue #1 of this four part series begins before Jay and Silent Bob meet Holden on that fateful day in the diner and meticulously describes the events that occur after. If you've seen Chasing Amy and plan to see Dogma, you can't miss this one!

